import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import Articles from './data.js';

import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import Card from 'react-bootstrap/Card';

import { Button, Nav, Navbar } from 'react-bootstrap';



function App() {
  return (

    <Container className='p-0 App' fluid>

      <Navbar bg="light" data-bs-theme="light">
        <Container fluid >
          <Navbar.Brand href="#home">React-Bootstrap</Navbar.Brand>
          <Navbar.Toggle aria-controls="basic-navbar-nav" />
          <Navbar.Collapse id="basic-navbar-nav">
            <Nav className="me-auto">
              <Nav.Link href="#home">Home</Nav.Link>
              <Nav.Link href="#link">Link</Nav.Link>
            </Nav>
          </Navbar.Collapse>
        </Container>
      </Navbar>

      <Container className='p_0 d-flex align-items-stretch App' fluid>
        <Row>
          <Col className='d-flex flex-column justify-content-center'>


          </Col>

          <Col xs={7} className='d-flex align-items-center'  >

            <Row xs={1} md={2} className="g-4 d-flex align-items-center">
              {Articles.slice(0,2).map((art, idx) => (
                <Col key={idx}>
                  <Card as={Button} variant="light" className="mb-2">
                    <Card.Img variant="top" src="holder.js/100px160" />
                    <Card.Body>
                      <Card.Title>{art.title}</Card.Title>
                      <Card.Text>
                        {art.description}
                      </Card.Text>
                    </Card.Body>
                  </Card>
                </Col>
              ))}
            </Row>

          </Col>
          <Col></Col>
        </Row>

      </Container>



    </Container >

  );
}

export default App;
